import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
} from 'react95';


export default ({setShowNapster}) => {
  const sites = [
    {
      'title': 'Dari Chan',
      url: '/guestbook'
    },
    {
      'title': 'My homepage',
      url: '/'
    }
  ]

  const [currentSite, setCurrentSite] = useState(sites[0]);

  return (
    <>
      <Window style={{width: '550px', height: '450px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>{currentSite.title}</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowNapster(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          Bookmarks: {sites.map(site => <Button>{site.title}</Button>)}
          <iframe style={{
            width: '100%',
            height: '340px'
          }} src='/'></iframe>
        </WindowContent>
      </Window>

    </>
  );
}
